Soo the last few days has been extremely exhausting. Wake up. Drive. Eat. Drive. Eat. Sleep. Repeat. And it doesn't help that the weather has turned gloomy with hard rainfall and wind. 

At 4 weeks in, I have come to understand that Van life is definitely not all a vacation. It is a lifestyle. It gets pretty hard and exhausting. It gets repeatitve and there really isn't a way to getaway from it really.... It's everything. Your way of transportation. Your home. Your only resource.  It is everything. 

Hopefully at our next destination we can have a little break. Hello Toronto, I've heard a lot about you... 

